import React, { useState } from 'react';
import './VideoAnalyzer.css';
import { AnalyzeVideo } from '../api/youtube.api';
import ToastNotification, { showTopToast } from '../components/toasts/toast';

interface VideoData {
    thumbnailPath: string;
    title: string;
    channelName: string;
    duration: string;
}

const transcriptData = {
  sentences: [
    {
      text: "Smoke from hundreds of wildfires in Canada is triggering air quality alerts throughout the US.",
      start: 250,
      end: 6350,
      confidence: 0.72412,
      words: [
        { confidence: 0.72412, start: 250, end: 650, text: "Smoke", speaker: null },
        { confidence: 0.99996, start: 730, end: 1022, text: "from", speaker: null },
        { confidence: 0.99992, start: 1076, end: 1466, text: "hundreds", speaker: null },
        { confidence: 1, start: 1498, end: 1646, text: "of", speaker: null }
      ]
    },
    {
      text: "Skylines from Maine to Maryland to Minnesota are gray and smoggy.",
      start: 6500,
      end: 11050,
      confidence: 0.99819,
      words: [
        { confidence: 0.99819, start: 6500, end: 7306, text: "Skylines", speaker: null },
        { confidence: 0.99987, start: 7338, end: 7534, text: "from", speaker: null },
        { confidence: 0.9972, start: 7572, end: 7962, text: "Maine", speaker: null },
        { confidence: 1, start: 8026, end: 8206, text: "to", speaker: null },
        { confidence: 0.5192, start: 8228, end: 8650, text: "Maryland", speaker: null },
        { confidence: 1, start: 8730, end: 8926, text: "to", speaker: null }
      ]
    }
  ]
};

export const VideoAnalyzer: React.FC = () => {
    const [url, setUrl] = useState('');
    const [video, setVideo] = useState<VideoData | null>(null);
    const [loading, setLoading] = useState(false);

    const handleAnalyze = async () => {
        if (!url) return;
        setLoading(true);
        try {
            const res = await AnalyzeVideo(url);

            if (res.success) {
                setVideo(res.data);
            }
        } catch (error: any) {
            showTopToast(error.message, "error", 5000);
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="analyzer-container">
            <ToastNotification/>
            <h1 className="analyzer-title">YouTube Video Analyzer</h1>
            <div className="analyzer-input-group">
                <input
                    type="text"
                    className="analyzer-input"
                    placeholder="Paste YouTube URL here..."
                    value={url}
                    onChange={(e) => setUrl(e.target.value)}
                />
                <button className="analyzer-button" onClick={handleAnalyze} disabled={loading}>
                    {loading ? 'Analyzing...' : 'Analyze'}
                </button>
            </div>

            {video && (
                <div className="analyzer-card">
                    <img src={`http://localhost:5000/thumbnails/${video.thumbnailPath.split('/').pop()}.png`} alt="Thumbnail" className="analyzer-thumbnail" />
                    <div className="analyzer-details">
                        <h2 className="analyzer-video-title">{video.title}</h2>
                        <p className="analyzer-channel">Channel: {video.channelName}</p>
                        <p className="analyzer-duration">Duration: {video.duration}</p>
                    </div>
                </div>
            )}

            <h2 className="transcript-title">Transcript</h2>
      {transcriptData.sentences.map((sentence, index) => (
        <div key={index} className="transcript-sentence">
          <div className="transcript-sentence-header">
            <span className="transcript-sentence-label">Sentence {index + 1}:</span>
            <span className="transcript-confidence">Confidence: {sentence.confidence.toFixed(2)}</span>
          </div>
          <p className="transcript-text">{sentence.text}</p>
          <ul className="transcript-word-list">
            {sentence.words.map((word, i) => (
              <li
                key={i}
                className={`transcript-word ${
                  word.confidence < 0.6 ? "transcript-word-low" : ""
                }`}
              >
                "{word.text}" â€” confidence: {word.confidence.toFixed(2)}, start: {word.start}, end: {word.end}
              </li>
            ))}
          </ul>
        </div>
      ))}
        </div>
    );
};

export default VideoAnalyzer;
